import React from 'react';

import { Link } from 'react-router-dom';

import './styles.css';

interface movementProps{
    title:string;
    description?: string;
}
const Movement: React.FC<movementProps> = (props) => {
    return (
        <header className="movement">
             <div className="perfil">
                    <Link to="/">
                        Perfil
                    </Link>
                </div>
                <div className="sair">
                    <Link to="/">
                        Sair
                    </Link>

                </div>
        </header>
    );
}
export default Movement;
